<template>
  <div>
    <popup ref="popup">
      <div class="myqr">
        <img :src="myqrurl">
      </div>
      <img src="https://cdn.xingkwh.com/close-.png" @click="_closeresult" class="cancelimg">
    </popup>
    <interlayer ref="interlayer" @close="_closeresult"></interlayer>
    <canvas ref="spread" width="600" height="970" class="spread hidek" style="width: 300px; height: 485px;"></canvas>
    <img class="spreadqr hidek" ref="qrimg" @load="_setcanvas">
    <!--<img  class="hidek" ref="avatar" :src="$root.user.avatar" v-if="$root.user.username"/>-->
    <img class="spreadimg hidek" src="data:image/jpeg;base64,"/>

  </div>
</template>

<script>
  import popup from 'base/popup/popup'
  import interlayer from 'base/interlayer/interlayer'
  import QRCode from 'qrcode'
  import {SPREED} from 'api/config'
  import {encryptByDES} from 'common/js/util'
  import {ENVIRONMENT, FACTOR} from 'api/config'

  export default {
    name: 'poster',
    data() {
      return {
        myqrurl: null,
      }
    },
    created() {
    },
    methods: {
      _closeresult() {
        this.$refs.popup._hiddenPopup()
        this.$refs.interlayer._hiddenLayer()
      },
      _setcanvas() {
        try {
          let canvas = document.querySelector('.spread')
          let imgbg = document.querySelector('.spreadimg')
          let imgqr = document.querySelector('.spreadqr')
          let context = canvas.getContext('2d')  //2D()
          context.drawImage(imgbg, 0, 0, 600, 970)
          context.drawImage(imgqr, 195, 500, 210, 210)
          context.fillStyle = '#fff'
          context.strokeStyle = '#fff' //
          context.textAlign = 'right'
          context.font = 'bold 28px \'\',\'\',\'\',\'\'' //
          context.fillText(`ID:${this.$root.user.username}`, 580, 38) //
          this.myqrurl = canvas.toDataURL('image/png')
          this.$root.eventHub.$emit('loading', null)
          this.$refs.popup._showPopup()
          this.$refs.interlayer._showLayer()
        } catch (err) {
          this.$root.eventHub.$emit('loading', null)
          console.log(err)
        }
      },
      _showqr() {
        if (this.myqrurl) {
          this.$refs.popup._showPopup()
          this.$refs.interlayer._showLayer()
          return false
        }
        const opts = {
          type: 'image/jpeg'
        }
        this.$root.eventHub.$emit('loading', true)
        let ability = encodeURIComponent(encryptByDES(JSON.stringify({
          username: this.$root.user.lower_code,
          environment: ENVIRONMENT
        }), FACTOR))
        QRCode.toDataURL(`${SPREED}?ability=${ability}`, opts, (err, url) => {
          if (err) {
            this.$root.eventHub.$emit('titps', '')
            console.error(err)
          } else {
            this.$refs.qrimg.src = url
          }
        })
      }
    },
    components: {
      popup,
      interlayer
    },
  }
</script>

<style scoped>
  .myqr {
    width: 300px;
    height: 485px;
    overflow: hidden;
    margin: 0 auto;
    border-radius: 10px;
  }

  .myqr img {
    width: 100%;
    height: 100%;
  }

  .cancelimg {
    display: block;
    transform: translate(0px, 68%);
    margin: 0 auto;
  }

  .hidek {
    opacity: 0;
    position: fixed;
    z-index: -99;
    top: 1000px;
    left: 0;
  }
</style>
